sys_variable_value.value:
(function execute(inputs, outputs) {

  if(inputs.status_code ==200){

  var resp = JSON.parse(inputs.response_body);
    outputs.hostname = resp.hostname;
    outputs.city = resp.city;
    outputs.region = resp.region;
    outputs.country = resp.country;

    var locArray = resp.loc.split(",");
    outputs.latitude = locArray[1];
    outputs.longitude = locArray[0];

  }

})(inputs, outputs);

